function ticTic(times) {
    var self = this;
    if(times==0||times===NaN)return;
    times-=1;
    this.withCSSTransitionDo(this.setRotation.curry(this.getRotation()+10*Math.PI/180), 100, function(){
        this.withCSSTransitionDo(this.setRotation.curry(this.getRotation()-2.5*Math.PI/180), 50, function(){
            self.ticTic(times)
        })
    });
}

