function createTabbedWindow(title, tabNames, optIcon) {
    var container = new lively.morphic.TabContainer();
    container.applyStyle({ borderWidth: 0 });
    container.tabBar.setExtent(container.tabBar.getExtent().withY(47));
    container.tabBar.applyStyle({ fill: null, borderWidth: 0 });

    tabNames.forEach(function(tabName) {
        this.createTab(container, tabName);
    }, this);

    var x = ($world.visibleBounds().x + $world.visibleBounds().width) * 0.1,
        y = ($world.visibleBounds().y + $world.visibleBounds().height),
        wnd = container.openInWindow({ pos: { x: x, y: y}, title: title });

    if (optIcon && wnd.titleBar.setIcon)
        wnd.titleBar.setIcon(optIcon);
    wnd.setExtent(lively.pt(700.0,608.0));
    wnd.setPositionAnimated(lively.pt(x, $world.visibleBounds().y + 50), 300);
    return wnd;
}

