function createTab(container, tabName) {
    container.tabBar.addTabLabeled(tabName);
    var tab = container.activeTab(),
        pane = container.activePane();

    tab.applyStyle({
        borderRadius: 10,
        borderWidth: 0,
        extent: tab.getExtent().withY(47),
        enableDragging: true,
        handStyle: 'move'
    });
    tab.label.applyStyle({
        fontFamily: 'Roboto',
        fontSize: 12,
        textColor: Global.Color.lively.darkGray
    });
    tab.closeButton.remove();
    tab.addScript(function getInactiveFill() {
        return Global.Color.lively.lightGray;
    });
    tab.addScript(function onDragStart() {
        var wnd = this.tabContainer.activePane().copy().openInWindow({
            title: this.getWindow().getTitle() + ' - ' + this.getLabel()
        });
        wnd.openInHand();
    });

    pane.applyStyle({
        borderRadius: 10,
        borderWidth: 0
    });
}
